import React from 'react'
import {  Grid, Paper,Card, CardMedia, CardContent, Typography } from '@material-ui/core';
import { makeStyles,withStyles } from '@material-ui/core/styles';
import '../style/questionlist.css'
import LinearProgress from '@material-ui/core/LinearProgress';


const BorderLinearProgress = withStyles((theme) => ({
    root: {
      height: 10,
      borderRadius: 5,
    },
    colorPrimary: {
      backgroundColor: theme.palette.grey[theme.palette.type === 'light' ? 200 : 700],
    },
    bar: {
      borderRadius: 5,
      backgroundColor: '#1a90ff',
    },
  }))(LinearProgress);

const useStyles = makeStyles((theme)=>({
    gridContainer: {
      paddingLeft: "20px",
      paddingRight: "20px",
      background:"#7555D9",
      minHeight:"100vh"
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
      },

  }));
function QuestionList() {
    const classes = useStyles();
    return (
        <div className={classes.gridContainer}>
              <Grid container>
        <Grid item xs>

        </Grid>
        <Grid item xs={11} sm={6} md={6} lg={4} >

        <div justify="center" className={classes.head}>
<h3 className="text1">2021 Friendship</h3>
<h3 className="text2">Dare</h3>
 <h4 className="question">Question <span>1/15</span></h4>
 <div className={classes.root}>
      <BorderLinearProgress variant="determinate" value={50} />
    </div>
</div>

          <Card className="form-card">
<form >
<h3 className="language">Select Language:</h3>
<select  defaultValue="Select Gender">
<option defaultValue>Select Gender</option>
<option value="male">Male</option>
<option value="female">Female</option>
</select>
<h3 className="language">Select Language:</h3>
<input type="text"  className="name" placeholder="FirstName..." /><br />
<div className="start-wrapper">
            <button className="started"> Start</button>
            </div>
</form>
</Card>

        </Grid>
        <Grid item xs>

        </Grid>

      </Grid>
        </div>
    )
}

export default QuestionList
